-- Подсчет количества гидов, туристов и экскурсий после каждой вставки
DROP TRIGGER IF EXISTS update_total_ex; 
CREATE TRIGGER update_total_ex AFTER INSERT ON excursion FOR EACH ROW
BEGIN
	SELECT COUNT(*) INTO @total_excursion FROM excursion e;
END;

DROP TRIGGER IF EXISTS update_total_gd; 
CREATE TRIGGER update_total_gd AFTER INSERT ON guids FOR EACH ROW
BEGIN
	SELECT COUNT(*) INTO @total_guid FROM guids g;
END;

DROP TRIGGER IF EXISTS update_total_tr; 
CREATE TRIGGER update_total_tr AFTER INSERT ON tourists FOR EACH ROW
BEGIN
	SELECT COUNT(*) INTO @total_tourist FROM tourists t ;
END;


